import React from 'react';
import './App.css';
import {  Routes, Route } from "react-router-dom";
import UserAccount from './components/userAccount/UserAccount'
function App() {
  return (
   
    <Routes>
      <Route path="/useraccount" element={<UserAccount/>}/>    
       
      </Routes>
    
  );
}

export default App;
